sys_variable_value.value:
(function execute(inputs, outputs) {
    inputs = new AmazonRDSUtils().trimStringInputs(inputs);
    var obj = {
        Tags: inputs.Tags
    }
    var str = new AmazonRDSUtils().createPayload(obj, "Tags");
    var session = gs.getSession();
    session.putClientData('SN_AWS_RDS_REGION', inputs.region ||
    "us-east-1");
    session.putClientData("SN_AWS_RDS_FILTER", str);
    outputs.region = inputs.region || "us-east-1";
    outputs.resource_name = inputs.resource_name;
})(inputs, outputs);

